void levelhard() {
  short circle_col = CHAR_COL;
  clear_screen();
  volatile int *JTAG_UART_ptr = (int *)JTAG_UART_BASE;
  int i;
  char c;
  draw_level3();
  circle(145, 25, 3, circle_col);

  int xc = 145, yc = 25;
  while (1) {
    c = get_jtag(JTAG_UART_ptr);
    if (c == 0x64) {
      int flag = 0;
      int j = yc;
      for (i = xc + 5; i < xc + 7; i++)
        if (read_pixel(i, j) == GREEN) flag = 1;
      if (!flag) {
        circle(xc, yc, 3, BLACK);
        xc += 10;
        circle(xc, yc, 3, circle_col);
      }
    }
    if (c == 0x61) {
      int flag = 0;
      int j = yc;
      for (i = xc - 5; i > xc - 7; i--)
        if (read_pixel(i, j) == GREEN) flag = 1;
      if (!flag) {
        circle(xc, yc, 3, BLACK);
        xc -= 10;
        circle(xc, yc, 3, circle_col);
      }
    }
    if (c == 0x77) {
      int flag = 0;
      int j = xc;
      for (i = yc - 5; i > yc - 7; i--)
        if (read_pixel(j, i) == GREEN) flag = 1;
      if (!flag) {
        circle(xc, yc, 3, BLACK);
        yc -= 10;
        circle(xc, yc, 3, circle_col);
      }
    }
    if (c == 0x73) {
      int flag = 0;
      int j = xc;
      for (i = yc + 5; i < yc + 7; i++)
        if (read_pixel(j, i) == GREEN) flag = 1;
      if (!flag) {
        circle(xc, yc, 3, BLACK);
        yc += 10;
        circle(xc, yc, 3, circle_col);
      }
    }
    if (xc == 145 && yc > 210) score += 15, draw_level_screen();
    if (c == 0x1b) {
      draw_level_screen();
      break;
    }
  }
}
