void rule_page() {
  clear_char();

  // gradient bg
  int x, y;
  int g = 20, b = 30;
  for (x = 0; x < 320; x++) {
    for (y = 0; y < 240; y++) {
      int r = (int)((float)(x) / (float)320 * 31.0);
      short color = ((r << 11) | (g << 5) | b);
      write_pixel(x, y, color);
    }
  }
  // border lines
  int i;
  for (i = 30; i <= 290; i++) write_pixel(i, 210, 0xff70);
  for (i = 20; i <= 300; i++) write_pixel(i, 220, 0xff70);
  for (i = 30; i <= 290; i++) write_pixel(i, 30, 0xff70);
  for (i = 20; i <= 300; i++) write_pixel(i, 20, 0xff70);
  for (i = 30; i <= 210; i++) write_pixel(30, i, 0xff70);
  for (i = 20; i <= 220; i++) write_pixel(20, i, 0xff70);
  for (i = 30; i <= 210; i++) write_pixel(290, i, 0xff70);
  for (i = 20; i <= 220; i++) write_pixel(300, i, 0xff70);

  write_string(30, 13, "RULES OF THE GAME:");
  write_string(30, 14, "-------------------");
  write_string(30, 18, "1. Use 'W' to move UP.");
  write_string(30, 20, "2. Use 'A' to move LEFT.");
  write_string(30, 22, "3. Use 'S' to move DOWN. ");
  write_string(30, 24, "4. Use 'D' to move RIGHT.");
  write_string(30, 26, "5. Reach the target to score points. ");
  write_string(30, 28, "6. Avoid obstacles and walls. ");

  write_string(30, 42, "* Press P to play the game *");

  volatile int *JTAG_UART_ptr = (int *)JTAG_UART_BASE;

  while (1) {
    char c = get_jtag(JTAG_UART_ptr);
    if (c == 0x70) {  // p play
      draw_level_screen();
      break;
    }
  }
}

void draw_level_screen() {
  clear_screen();
  volatile int *JTAG_UART_ptr = (int *)JTAG_UART_BASE;
  int k = 0;
  int i;
  char c;

  // gradient bg
  int x, y;
  int g = 20, b = 30;
  for (x = 0; x < 320; x++) {
    for (y = 0; y < 240; y++) {
      int r = (int)((float)(x) / (float)320 * 31.0);
      short color = ((r << 11) | (g << 5) | b);
      write_pixel(x, y, color);
    }
  }
  // border lines
  for (i = 30; i <= 290; i++) write_pixel(i, 210, 0xff70);
  for (i = 20; i <= 300; i++) write_pixel(i, 220, 0xff70);
  for (i = 30; i <= 290; i++) write_pixel(i, 30, 0xff70);
  for (i = 20; i <= 300; i++) write_pixel(i, 20, 0xff70);
  for (i = 30; i <= 210; i++) write_pixel(30, i, 0xff70);
  for (i = 20; i <= 220; i++) write_pixel(20, i, 0xff70);
  for (i = 30; i <= 210; i++) write_pixel(290, i, 0xff70);
  for (i = 20; i <= 220; i++) write_pixel(300, i, 0xff70);

  write_string(28, 13, "CHOOSE DIFFICULTY :");
  write_string(28, 14, "-------------------");
  write_string(28, 18, "Press 1 for EASY ( +5 points )");
  write_string(28, 20, "Press 2 for MEDIUM ( +10 points )");
  write_string(28, 22, "Press 3 for HARD ( +15 points ) ");
  write_string(28, 28, "* PRESS R TO READ THE RULES *");

  write_string(28, 36, "Points Scored : ");
  write_string(45, 36, convert_to_str(score));
  write_string(28, 45, "* Press Q to Quit *");

  while (1) {
    c = get_jtag(JTAG_UART_ptr);
    if (c == 0x71) {  // q- quit
      score=0;
      home_screen();
      break;
    }
    if (c == 0x31) {  // 1
      leveleasy();
      break;
    }
    if (c == 0x32) {  // 2
      levelmedium();
      break;
    }
    if (c == 0x33) {  // 3
      levelhard();
      break;
    }
    if (c == 0x72) {
      rule_page();
      break;
    }
  }
}
void home_screen() {
  clear_screen();
  // gradient bg
  int x, y;
  // int g=20, b=30;
  for (x = 0; x < 320; x++) {
    for (y = 0; y < 240; y++) {
      write_pixel(x, y, bg[x][y]);
    }
  }

  char *hw3 = "Press S to START";
  x = 30;
  while (*hw3) {
    write_char(x, 48, *hw3);
    x++;
    hw3++;
  }

  volatile int *JTAG_UART_ptr = (int *)JTAG_UART_BASE;
  char c;

  while (1) {
    c = get_jtag(JTAG_UART_ptr);
    if (c == 0x73) {
      draw_level_screen();
      break;
    }
  }
}

int main() {
  home_screen();

  return 0;
}